import styled from 'styled-components/native';

export const Container = styled.View`
width: 100%;
height: 100%;
background-color: #dbdbdb;
align-items: center;
justify-content: center;
`;

export const Content = styled.SafeAreaView`
background-color: #dbdbdb;
position: absolute;
width: 100%;
height: 75%;
`;

export const DataContent = styled.View`
background-color: #dbdbdb;
color: #677689;
width: 95%;
min-height: 100px;
margin-bottom: 20px;
left: 10px;
align-items: baseline;
justify-content: center;
border-color: #677689;
border-top-width: 10px;
border-width: 2px;
elevation: 2;
`;

export const DataLab = styled.Text`
color: #677689;
font-size: 20px;
font-weight: bold;
text-align: left;
`;

export const DataReplyLab = styled.Text`
color: #8395ab;
font-size: 18px;
font-weight: bold;
`;

export const DataLimiter = styled.View`
background-color: transparent;
flex: 1;
width: 93%;
height: 90%;
margin: 10px;
`;

export const IconsContent = styled.View`
background-color: transparent;
flex-direction: row;
flex: 1;
width: 93%;
height: 90%;
margin: 10px;
`;

export const IconContent = styled.TouchableOpacity`
background-color: #677689;
border-radius: 3px;
align-items: center;
justify-content: center;
width: 30px;
height: 25px;
margin: 5px;
`;

export const TopContainer = styled.View`
background-color: #dbdbdb;
position: absolute;
top: 0;
align-items: center;
justify-content: center;
width: 100%;
height: 90px;
flex: 1;
flex-direction: row;
`;

export const TopContainerModal = styled.View`
background-color: #dbdbdb;
position: absolute;
top: 10px;
align-items: center;
justify-content: center;
width: 100%;
height: 100px;
flex: 1;
flex-direction: row;
`;

export const ContainerSearch = styled.View`
background-color: #dbdbdb;
color: #677689;
width: 15%;
height: 45px;
margin-bottom: 15px;
margin-right: 0px;
align-items: center;
justify-content: center;
border-width: 2px;
border-color: #677689;
border-right-width: 0;
elevation: 2;
`;

export const SearchInput = styled.TextInput`
background-color: #dbdbdb;
color: #677689;
width: 50%;
height: 45px;
padding: 10px;
margin-bottom: 15px;
border-width: 2px;
border-color: #677689;
border-left-width: 0;
elevation: 2;
`;

export const SearchInputModal = styled.TextInput`
background-color: #dbdbdb;
color: #677689;
width: 70%;
height: 45px;
padding: 10px;
margin-bottom: 15px;
border-width: 2px;
border-color: #677689;
border-left-width: 0;
elevation: 2;
`;

export const BackModal = styled.TouchableOpacity`
background-color: #677689;
width: 100%;
height: 40px;
align-items: center;
justify-content: center;
`;

export const Filter = styled.TouchableOpacity`
background-color: #dbdbdb;
color: #677689;
width: 15%;
height: 40px;
margin-bottom: 15px;
margin-left: 10px;
border-radius: 5px;
align-items: center;
justify-content: center;
border-width: 2px;
border-color: #677689;
elevation: 4;
`;

export const BackContainer = styled.View`
background-color: #dbdbdb;
position: absolute;
bottom: 0;
align-items: center;
justify-content: center;
width: 100%;
height: 90px;
flex: 1;
flex-direction: row;
`;

export const BackContent = styled.TouchableOpacity`
align-items: center;
justify-content: center;
background-color: #d9d9d9;
border-radius: 5px;
width: 40%;
height: 60%;
elevation: 2;
margin-left: 10px;
`;

export const Separator = styled.View`
background-color: #8395ab;
width: 100%;
height: 1px;
`;

export const DataInput = styled.TextInput`
width: 100%;
height: 45px;
border-width: 2px;
padding: 10px;
color: #677689;
border-color: #677689;
`;

export const Selected = styled.View`
position: absolute;
right: 0;
height: 100%;
align-items: center;
justify-content: center;
`;

export const ContainerFilterModal = styled.View`
border-radius: 5px;
width: 100%;
height: 100%;
justify-content: center;
align-items: center;
`;

export const FilterContent = styled.View`
width: 80%;
height: 50%;
elevation: 3;
justify-content: center;
align-items: center;
background-color: #d9d9d9;
`;

export const FilterForm = styled.View`
width:100%;
height: 70%;
align-items: center;
`;

export const Close = styled.TouchableOpacity`
position: absolute;
top: 0;
left: 0;
width: 30px;
height: 30px;
margin: 5px;
justify-content: center;
align-items: center;
`;
